import React from 'react';
import '../styles/About.scss'

const About = () =>{
    return (
        <>
        <div className='card'>
            <h3>About Taylor</h3>
            <p>Born and raised in Casper, Wyoming, I like to bring the "small town" culture in which I was raised to all of my work. Treating people with respect, taking pride in your work, and a strong committment to success are the values that guide me. I graduated with an A.A. in Multimedia Communications in May of 2019. After graduation I moved to Las Vegas to soak up the thriving culture and arts scene, and continue my education in Web Development.</p>
            <p>Web development and design are not my only passions in life. I am also an avid follower of sports. My favorite teams are the Los Angeles Lakers, the Philadelphia Eagles, and the Atlanta Braves. Growing up in Wyoming I never had any local professional sports teams to root for, so I had to pick from the ones I could see on TV. I played baseball until college, but recently discovered an intense love of golf. These days almost all of my free time is spent on the links, which works out well in Las Vegas. I find the golf course is a great place to unwind and let my mind wander, which often helps me in my professional life. In addition to my addiction to golf, I also have a fantasy football podcast.</p>
        </div>
        <div className='spacing'>
            <p> </p>
        </div>
        </>
    )
}

export default About;
